import { productsType } from "../types/Types";
// remove any
export const filterProductsData = (products: productsType[]): any => {
  // TODO: karchacnel, aranc avelord return-neri
  // TODO: kardal type inference ev vor depqerum e lav grel vor depqeum arzhi chgrel type-@
  const [id, description, image, price,title, count] = products
  const filteredUsers: productsType[] = products.map((product): productsType => ({    
    id: id,
    description: product.description,
    image: product.image,
    price: Math.floor(product.price),
    title: product.title,
    count: 1,
    })
  );
  // TODO: destructure  

  return filteredUsers;
};
